import React from "react";
import {Button} from "reactstrap"


const NavbarButtons = (props: any) => {
    return(
        <div className="navbar-buttons">
             <Button className="" outline color="secondary">UI Components</Button>{' '}
             <Button className="" outline color="secondary">Utils</Button>{' '}
             <Button className="" outline color="secondary">CG</Button>{' '}
             <Button className="" outline color="secondary">Other</Button>{' '}
        </div>
    )
}

export default NavbarButtons;
